import React from "react";
import CountdownTimer from "../Countdown";
import { Icon } from './Icon';

export const Home = () => {
  return (
    <div className="home">
      <img className='logo-gta' src='logo-gta.png' alt="Grand Theft Auto VI" />
      <h1 className="title">RELEASE DATE</h1>
      <CountdownTimer />
      <p className="release-date">COMING IN SEPTEMBER 2025</p>
      <a href className="new-games">
        <Icon
          iconName="Stopwatch"
          color="black"
          size={96}
          className="align-top"
        />
      </a>
    </div>
  );
};
